import React from "react";
import Motor3d from "../generalLayout/motor3d";
import PageName from "../generalLayout/pageName";
import MotorPageHeader from "../generalLayout/motorPageHeader";
import MotorSlideImg from "../generalLayout/motorSlideImg";
import MvEmail from "../generalLayout/mvEmail";
import { ScrollNavFunction } from "../generalFunctionForOnScroll/ScrollEventFor_MotorPage";
import { FooterGe } from "../generalLayout/footer_test";
import Nav from "../generalLayout/nav";
import { NavWhiteCompact } from "../generalFunctionForOnScroll/ScrollEventFor_Homepage";
import NavDesktop from "../generalLayout/navDesk";
import DesignTips from "../generalLayout/designTips";
const namePage = "Dragster 800 RR SCS";
const nameHeaderTitle = "dragster800rrscs/dragster-800-rr-scs.svg";
const contentHeaderContent =
  "Dragster exudes exuberance and character. Born to inspire and ready to burn the tarmac, effortlessly and carefree thanks to its smart shifting system.";
const price = "19.490";
const colorBg = "#c29b2f";
const listImgs = [
  {
    contentTitle: "EMOTIONS WITHOUT COMPROMISE",
    img: "dragster800rrscs/DRA-SCS-performance-min.png",
    content:
      "Super compact, aggressive, stunningly good looking. The design of the Dragster 800 RR takes no prisoners. Emotion in its purest form.",
  },
  {
    contentTitle: "EVOLUTION OF PERFECTION",
    img: "dragster800rrscs/DRA-SCS-meccanica-min.png",
    content:
      "The three-cylinder engine was improved to comply with Euro 4 regulation and also to enhance performance and reliability. The engine’s anchoring point to the frame has been revised, as well as the primary gears, valve guides and the cam phasing. The gearbox is also new, quicker and requires less force on the lever to engage gears.",
  },
  {
    contentTitle: "NEW DETAILS, UNVARIED CHARACTER",
    img: "dragster800rrscs/DRA-SCS-design-min.png",
    content:
      "The front fender’s side supports are made of aluminium, like the tank damper. The headlight has a new integrated light guide and the tail light is now a single unit.",
  },
  {
    contentTitle: "3 YEARS WARRANTY",
    img: "dragster800rrscs/mv-3-years-warranty.jpg",
    content:
      "MV Agusta offers a NEW 3 YEARS WARRANTY on the whole range, with a great service support for all customers. Customize your experience riding a model, discovering special kits and the vast range of readily available spare parts.",
  },
];
const imgSlideSrc = [
  "img/dragster800rrscs/1.jpg",
  "img/dragster800rrscs/2.jpg",
  "img/dragster800rrscs/3.jpg",
  "img/dragster800rrscs/4.jpg",
];
const manifesto_Arr = ["THE", "SMART", "STREET", "FIGHTER"];
export default function BodyDragster800RRSCS() {
  window.addEventListener("scroll", () => {
    ScrollNavFunction();
    NavWhiteCompact();
  });
  return (
    <>
      <div
        className="nav-pc-homepage"
        style={{
          height: "84px",
          width: "100vw",
          background: "rgb(194, 155, 47)",
        }}
      ></div>
      <NavDesktop />
      <Nav color="white"/>
      <PageName namePage={namePage}></PageName>
      <MotorPageHeader
        manifesto_Arr={manifesto_Arr}
        nameHeaderTitle={nameHeaderTitle}
        titleSize="auto 25%"
        colorBg={colorBg}
        contentHeaderContent={contentHeaderContent}
        price={price}
        bgHeaderParallax="dragster800rrscs/dragster-800-rr-xl.png"
        reveredContent={false}
        heightContentTop="11.5%"
      />
      <Motor3d
        imgLocate="dragster800rrscs/dragster800rr"
        nameModel="MV AGUSTA DRAGSTER 800 RR SCS"
        price={price}
      />
      <DesignTips />
      <br />
      <br />
      <MotorSlideImg imgSlideSrc={imgSlideSrc} />
      <br></br>
      <br></br>
      <MvEmail />
      <br />
      <FooterGe />
    </>
  );
}
